INSERT INTO `product` VALUES (1046,'1970 Chevy Chevelle SS 454','Unimax Art Galleries','This model features rotating wheels, working streering system and opening doors. All parts are particularly delicate due to their precise scale and require special care and attention. It should not be picked up by the doors, roof, hood or trunk.',1005,49.24,73.49,'Cars',NULL,NULL,NULL,NULL),(1097,'1940 Ford Pickup Truck','Studio M Art Models','This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood,  removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box',2613,58.33,116.67,'Trucks',NULL,NULL,NULL,NULL),(1099,'1968 Ford Mustang','Autoart Studio Design','Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color dark green.',68,95.34,194.57,'Cars',NULL,NULL,NULL,NULL),(1108,'2001 Ferrari Enzo','Second Gear Diecast','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',3619,95.59,207.8,'Cars',NULL,NULL,NULL,NULL),(1129,'1993 Mazda RX-7','Highway 66 Mini Classics','This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color red.',3975,83.51,141.54,'Cars',NULL,NULL,NULL,NULL),(1138,'The Schooner Bluenose','Autoart Studio Design','All wood with canvas sails. Measures 31 1/2 inches in Length, 22 inches High and 4 3/4 inches Wide. Many extras.\r\nThe schooner Bluenose was built in Nova Scotia in 1921 to fish the rough waters off the coast of Newfoundland. Because of the Bluenose racing prowess she became the pride of all Canadians. Still featured on stamps and the Canadian dime, the Bluenose was lost off Haiti in 1946.',1897,34,66.67,'Ships',NULL,NULL,NULL,NULL),(1253,'Boeing X-32A JSF','Motor City Art Classics','10\" Wingspan with retractable landing gears.Comes with pilot',4857,32.77,49.66,'Planes',NULL,NULL,NULL,NULL),(1268,'1980?s GM Manhattan Express','Motor City Art Classics','This 1980?s era new look Manhattan express is still active, running from the Bronx to mid-town Manhattan. Has 35 opeining windows and working lights. Needs a battery.',5099,53.93,96.31,'Trucks',NULL,NULL,NULL,NULL),(1341,'1930 Buick Marquette Phaeton','Studio M Art Models','Features opening trunk,  working steering system',7062,27.06,43.64,'Cars',NULL,NULL,NULL,NULL),(1342,'1937 Lincoln Berline','Motor City Art Classics','Features opening engine cover, doors, trunk, and fuel filler cap. Color black',8693,60.62,102.74,'Cars',NULL,NULL,NULL,NULL),(1367,'1936 Mercedes-Benz 500K Special Roadster','Studio M Art Models','This 1:18 scale replica is constructed of heavy die-cast metal and has all the features of the original: working doors and rumble seat, independent spring suspension, detailed interior, working steering system, and a bifold hood that reveals an engine so accurate that it even includes the wiring. All this is topped off with a baked enamel finish. Color white.',8635,24.26,53.91,'Cars',NULL,NULL,NULL,NULL),(1374,'1997 BMW F650 ST','Exoto Designs','Features official die-struck logos and baked enamel finish. Comes with stand.',178,66.92,99.89,'Motorcycles',NULL,NULL,NULL,NULL),(1392,'Diamond T620 Semi-Skirted Tanker','Highway 66 Mini Classics','This limited edition model is licensed and perfectly scaled for Lionel Trains. The Diamond T620 has been produced in solid precision diecast and painted with a fire baked enamel finish. It comes with a removable tanker and is a perfect model to add authenticity to your static train or car layout or to just have on display.',1016,68.29,115.75,'Trucks',NULL,NULL,NULL,NULL),(1444,'1970 Dodge Coronet','Highway 66 Mini Classics','1:24 scale die-cast about 18\" long doors open, hood opens and rubber wheels',4074,32.37,57.8,'Cars',NULL,NULL,NULL,NULL),(1514,'1962 City of Detroit Streetcar','Classic Metal Creations','This streetcar is a joy to see. It has 99 separate windows, electric wire guides, detailed interiors with seats, poles and drivers controls, rolling and turning wheel assemblies, plus authentic factory baked-enamel finishes (Green Hornet for Chicago and Cream and Crimson for Boston).',1645,37.49,58.58,'Trains',NULL,NULL,NULL,NULL),(1578,'1997 BMW R 1100 S','Autoart Studio Design','Detailed scale replica with working suspension and constructed from over 70 parts',7003,60.86,112.7,'Motorcycles',NULL,NULL,NULL,NULL),(1589,'1965 Aston Martin DB5','Classic Metal Creations','Die-cast model of the silver 1965 Aston Martin DB5 in silver. This model includes full wire wheels and doors that open with fully detailed passenger compartment. In 1:18 scale, this model measures approximately 10 inches/20 cm long.',9042,65.96,124.44,'Cars',NULL,NULL,NULL,NULL),(1628,'1966 Shelby Cobra 427 S/C','Carousel DieCast Legends','This diecast model of the 1966 Shelby Cobra 427 S/C includes many authentic details and operating parts. The 1:24 scale model of this iconic lighweight sports car from the 1960s comes in silver and it\'s own display case.',8197,29.18,50.31,'Cars',NULL,NULL,NULL,NULL),(1662,'1980s Black Hawk Helicopter','Red Start Diecast','1:18 scale replica of actual Army\'s UH-60L BLACK HAWK Helicopter. 100% hand-assembled. Features rotating rotor blades, propeller blades and rubber wheels.',5330,77.27,157.69,'Planes',NULL,NULL,NULL,NULL),(1666,'1958 Setra Bus','Welly Diecast Productions','Model features 30 windows, skylights & glare resistant glass, working steering system, original logos',1579,77.9,136.67,'Trucks',NULL,NULL,NULL,NULL),(1678,'1969 Harley Davidson Ultimate Chopper','Min Lin Diecast','This replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. All parts are particularly delicate due to their precise scale and require special care and attention.',7933,48.81,95.7,'Motorcycles',NULL,NULL,NULL,NULL),(1691,'American Airlines: B767-300','Min Lin Diecast','Exact replia with official logos and insignias and retractable wheels',5841,51.15,91.34,'Planes',NULL,NULL,NULL,NULL),(1749,'1917 Grand Touring Sedan','Welly Diecast Productions','This 1:18 scale replica of the 1917 Grand Touring car has all the features you would expect from museum quality reproductions: all four doors and bi-fold hood opening, detailed engine and instrument panel, chrome-look trim, and tufted upholstery, all topped off with a factory baked-enamel finish.',2724,86.7,170,'Cars',NULL,NULL,NULL,NULL),(1785,'1928 British Royal Navy Airplane','Classic Metal Creations','Official logos and insignias',3627,66.74,109.42,'Planes',NULL,NULL,NULL,NULL),(1889,'1948 Porsche 356-A Roadster','Gearbox Collectibles','This precision die-cast replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.',8826,53.9,77,'Cars',NULL,NULL,NULL,NULL),(1937,'1939 Chevrolet Deluxe Coupe','Motor City Art Classics','This 1:24 scale die-cast replica of the 1939 Chevrolet Deluxe Coupe has the same classy look as the original. Features opening trunk, hood and doors and a showroom quality baked enamel finish.',7332,22.57,33.19,'Cars',NULL,NULL,NULL,NULL),(1938,'The Mayflower','Studio M Art Models','Measures 31 1/2 inches Long x 25 1/2 inches High x 10 5/8 inches Wide\r\nAll wood with canvas sail. Extras include long boats, rigging, ladders, railing, anchors, side cannons, hand painted, etc.',737,43.3,86.61,'Ships',NULL,NULL,NULL,NULL),(1949,'1952 Alpine Renault 1300','Classic Metal Creations','Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.',7305,98.58,214.3,'Cars',NULL,NULL,NULL,NULL),(19